import React from 'react';
import {StyleSheet} from "react-native";

export const globalStyles = StyleSheet.create({

    button: {
        marginLeft: 60,
        marginRight: 60,
        alignItems: 'center',
        padding: 20,
        backgroundColor: '#D50000',
        marginTop: 30
    },
    buttonText: {
        color: '#fff',
        fontWeight: 'bold'
    },
});
